import { useState } from 'react';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

const Create = () => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    const [nom, setNom] = useState("");
    const [prenom, setPrenom] = useState("");
    const [date, setDate] = useState("");


    // const handleClick = (e) => {
    //     setNom(e.target.value)
    // }

    return (
        <>
            <Button variant="primary" onClick={handleShow}>
                Launch demo modal
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Entrer les informations</Modal.Title>
                </Modal.Header>

                <FloatingLabel
                    controlId="floatingInput"
                    label="Email address"
                    className="mb-3"
                >
                    <Form.Control type="email" value={nom} onClick={ handleClic = (e) => { setNom(e.target.value) }} placeholder="name@example.com" />
                </FloatingLabel>

                <FloatingLabel controlId="floatingPassword" label="Password">
                    <Form.Control type="password" value={prenom} placeholder="Password" />
                </FloatingLabel>


                <FloatingLabel controlId="floatingPassword" label="date">
                    <Form.Control type="password" value={date} placeholder="date" />
                </FloatingLabel>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" onClick={handleClose}>
                        Save Changes
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
}

export default Create;
